  \ CASE WHEN SNOWFLAKE.CORTEX.COMPLETE(summarized_notes, 'random') = 'random' THEN\
  \ 'random' ELSE 'random' END AS in_renewal_process,\nSNOWFLAKE.CORTEX.COMPLETE(summarized_notes,\
  \ 'random') AS last_renewed_date FROM contract_analysis;"
